      <div class=""blog-post"">
        <h2 class=""blog-post-title"">Внедрение WMS на складе</h2>
        <p class=""blog-post-meta"">15 Ноября, 2020 <a>Данила</a></p>

        <p>Кейс разработчика программных решений First Line Software, который тиражировал систему управления viadatWMS на новом складе машиностроительного завода Ростсельмаш в Ростове-на-Дону.</p>
        <hr>
        <p>Основанный в советское время машиностроительных завод Ростсельмаш котируется в мире и сегодня. Пятая часть всей производимой зерноуборочной техники предприятие поставляет на экспортный рынок. В модельной линейке есть несколько тракторов и комбайнов с технологиями искусственного интеллекта.</p>
        <blockquote>
        <h2>Что делать?</h2>
        <p>Нам нужно было ав");
                WriteLiteral(@"томатизировать новое складское помещение Ростсельмаш, запланированное под задачи хранения и распределения комплектующих и запчастей завода.</p>
        </blockquote>
      </div>

      <div class=""blog-post"">
        <h2 class=""blog-post-title"">Выгоревший бизнесмен - будущий инфоцыган или сектант.</h2>
        <p class=""blog-post-meta"">Ноябрь 18, 2020  <a>Данила</a></p>

        <p>Среднестатистический инфоцыган - это типовая бездарность или посредственность, у которой было огромное желание обрести статус успешного бизнесмена вкупе с существенными материальными амбициями.</p>
        <blockquote>
          <p>Потому что <strong>""бизнес - это просто"" и ""ведь я этого достойна""</strong>. И потому что кто-то уже ""стал миллионером в 20 лет"" (на самом деле - нет), а ты всё ещё не открыл своё дело и не начал грести бабло лопатой.

</p>
        </blockquote>
        <p>Соответственно, из провалившейся / выгоревшей бизнес-бездарности и бизнес-посредственности получаются первостатейные инфоцыгане. А заод");
                WriteLiteral(@"но и сектанты.</p>
        <p>Однако теперь формируется новый класс инфоцыган, который ""Криптокритика"" находит куда более опасным, чем обычные инфоцыгане.</p>
      </div>

      <div class=""blog-post"">
        <h2 class=""blog-post-title"">Кейс SALTLIGHT: как мы заработали $500 000, помогая спасаться от коронавируса</h2>
        <p class=""blog-post-meta"">Ноябрь 18, 2020 <a>Кирилл</a></p>

        <p>Любой кризис создаёт и новые проблемы, и новые возможности. Это утверждение отлично иллюстрирует история SALTLIGHT: стартапа, который появился в самый разгар пандемии и всего за 3 месяца вырос до международной организации, в отделе продаж которой работает больше полутора сотен сотрудников.</p>
        <p>О том, как произошёл такой взрывной старт, рассказывает один из основателей компании, Егор Липовецкий.</p>
        <p>В марте-апреле, когда в России начались ограничения из-за COVID, мы с партнёрами оказались в сложном положении. Если кратко, то в пандемию, как и у 80% бизнесов в сфере услуг, у нас упали ");
                WriteLiteral(@"обороты: стройка, массажные салоны – все проекты, которые мы вели, оказались в сложной ситуации. Выручка снизилась, перспективы были очень туманные, полная неопределенность и неразбериха.
        Сейчас у нас больше 70 дилеров. Рециркуляторы SALTLIGHT сегодня стоят в крупнейших сетях фастфуда, аптеках и ещё десятках и сотнях компаний, продажи продолжают расти. Своевременный старт, востребованная идея и мультипликация через партнёрскую сеть – вот три основы, на которых построен успех SALTLIGHT. Дальнейший потенциал сегмента колоссален, поэтому в будущее мы смотрим с оптимизмом.</p>
